struct Solution;

use std::collections::{BTreeMap, BTreeSet, HashMap};

impl Solution {

    fn swap(num: Vec<u8>, idx1: usize, idx2: usize) -> Vec<u8> {
        let mut num = num;
        (num[idx1], num[idx2]) = (num[idx2], num[idx1]);
        num
    }

    fn generate_combinations_using_swap(num: Vec<u8>) -> BTreeSet<Vec<u8>> {
        let mut combination = BTreeSet::new();
        combination.insert(num.clone());
        for (i, _) in num.iter().enumerate() {
            for (j, _) in num.iter().enumerate() {
                if j > i {
                    combination.insert(Solution::swap(num.clone(), i, j));
                }
            }
        }
        combination
    }

    fn generate_combinations(num: i32) -> BTreeSet<i32> {
        let num = num.to_string().as_bytes().to_vec();
        let mut final_result = BTreeSet::new();

        for num in Solution::generate_combinations_using_swap(num).iter() {
            let comb = Solution::generate_combinations_using_swap(num.clone());
            for num in comb {
                final_result.insert(String::from_utf8(num).unwrap().parse::<i32>().unwrap());
            }
        }

        final_result
    }

    pub fn count_pairs(nums: Vec<i32>) -> i32 {
        let mut num_freq = BTreeMap::new();
        for num in nums.into_iter() {
            num_freq.entry(num).and_modify(|f| *f+=1).or_insert(1);
        }

        let mut combinations_map: HashMap<i32, i32> = HashMap::new();

        let num_freq = num_freq.into_iter().rev().collect::<Vec<(i32,i32)>>();

        num_freq.iter().enumerate().map(|(i, (num_1, freq)) | {
            let m = match combinations_map.get(num_1) {
                Some(f) =>  freq * (freq - 1) / 2 + freq * f,
                None => freq * (freq - 1) / 2 
            };
            for comb in Solution::generate_combinations(num_freq[i].0).iter() {
                match combinations_map.get_mut(comb) {
                    None => {
                        combinations_map.insert(comb.clone(), num_freq[i].1);
                    }
                    Some(f) => *f += num_freq[i].1,
                }
            }
            m
        }).sum()
    }
}

